package practicePrograms;

public class positivenegative {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number = 25;
		if (number > 0) {
			System.out.println("POSITIVE");
		} else if (number < 0) {
			System.out.println("NEGATIVE");
		} else {
			System.out.println("ZERO");
		}
	}

}
